  false,\n\t\"url\": null,\n\t\"notes\": \"Locations and contact information for Chicago
  primary care community health clinics (including all federally qualified health
  centers and similar community health centers that provide primary care and are open
  to the general community).  Additional information can be found at: http://j.mp/QfZ7SPrnrnCDPH
  anticipates that this list will be used in the following ways: 1) by residents who
  are in need of rnassistance in finding a primary care physician and clinic near
  their homes; 2) by social service and rnpublic sector service providers that want
  to link their consumers to primary care near their homes; 3) rnby health system
  and public health researchers who are interested in Chicagou2019s primary care and
  rnsafety net provider landscape. rn rnClinics were excluded from this list if a)
  it is not specifically in their mission to care for underserved rnpopulations or
  b) if clinic services are only available to a narrowly defined population. rn rnDisclaimers:
  This list is intended to be a working document of primary care clinics for underserved
  rnpopulations in Chicago. If you believe an entry on this list to be outdated, misrepresented,
  or rnotherwise in error, please contact healthychicago@cityofchicago.org.\",\n\t\"license_title\":
